import React from 'react';
import classes from './MyPosts.module.css';
import Post from './Post/Post';

const MyPosts = (props) => {

    let posts = [
        {id: 1, message: 'Hi, how are you?', likesCount: 3},
        {id: 2, message: 'It\'s my first post', likesCount: 6},
        {id: 3, message: 'It\'s my second post', likesCount: 0},
        {id: 4, message: 'It\'s my second post', likesCount: 10},
        {id: 5, message: 'It\'s my second post', likesCount: 4}
    ];

    let postElements = posts.map( p => <Post message={p.message} likesCount={p.likesCount} /> );

    return (
        <div>
            <div>
                My post
        </div>
            <div>
                <textarea></textarea>
                <button>Post</button>
            </div>
            <div>
                {postElements}
            </div>
        </div>
    );
}

export default MyPosts;
